import React from "react";

function ListChartHeader() {
  return (
    <div class="header">
      <li class="navbar">
          <a id="header-content">Makonis</a>
          <a id="home" href="./">Home</a>
      </li>
    </div>
  );
}

export default ListChartHeader;
